2. Klasse 
public class Grusskarte {
	
	 // Instanzvariable
	protected String text;
	protected String name;

	// Konstruktor
	public Grusskarte (String text, String name) {
		this.text = text;
		this.name = name;
	}
	// Methoden
	public String getText() {
		return "\n\t" + text + name;
	}

}
